import React, { Fragment } from "react";
import "../Styles/seed.css";
import ChevronUpDouble from '../assets/icons/chevron_up_double.svg'
import Close from '../assets/icons/close.svg'
import Create from '../assets/icons/create.svg'
import Diamond from '../assets/icons/diamond.svg'
import Eye from '../assets/icons/eye.svg'
import FingerPrint from '../assets/icons/fingerprint.svg'
import Home from '../assets/icons/home.svg'
import Link from '../assets/icons/link.svg'
import MessageWriting from '../assets/icons/message_writing.svg'
import PaperClip from '../assets/icons/paperclip.svg'
import Picture from '../assets/icons/picture.svg'
import Plus from '../assets/icons/plus.svg'
import Rocket from '../assets/icons/rocket.svg'
import Target from '../assets/icons/target.svg'
import UserMaleCircle from '../assets/icons/user_male_circle.svg'

export default function Icon(props) {
  const { className, icon, iconClassName, ChevronUpDouble, Close, Create, Diamond, Eye, FingerPrint, Home, Link, MessageWriting, PaperClip, Picture, Plus, Rocket, Tartet, UserMaleCircle } = props;

  return (
    <Fragment><div className={` ${className} h-pr-fl-ma r-h-c b-s-b-b `}>
       <img className={` ${iconClassName } w-100 h-100  p-r m-a r-v-c p-5px `} Style="object-fit: cover;" src={` ${Eye}`}/>
      </div></Fragment>
  );
 
}
